import React from 'react'
import CIcon from '@coreui/icons-react'
import {
  // cilBell,
  // cilCalculator,
  //cilChartPie,
  // cilCursor,
  // cilDrop,
  //cilNotes,
  //cilPencil,
  cilHome,

  cilHospital,
  //cilPuzzle,
  //cilSpeedometer,
  cilStar,
} from '@coreui/icons'
import { CNavGroup, CNavItem, CNavTitle } from '@coreui/react'

const _nav = [
  {
    component: CNavItem,
    name: 'Dashboard',
    to: '/dashboard',
    icon: <CIcon icon={cilHome} customClassName="nav-icon" />,
   /* badge: {
      color: 'info',
      text: 'NEW',
    },*/
  },

  {
    component: CNavGroup,
    name: 'Doctor',
    to: '/Doctor',
    icon: <CIcon icon={ cilHospital} customClassName="nav-icon" />,
    items: [
      {
        component: CNavItem,
        name: 'All Doctor',
        to: '/Doctor/All Doctor',
      },
      {
        component: CNavItem,
        name: 'Add Doctor',
        to: '/Doctor/Add Doctor',
      },
      {
        component: CNavItem,
        name: 'Doctor profile',
        to: '/Doctor/Doctor profile',
      },
    ],
  },
  {
    component: CNavGroup,
    name: 'Appointment',
    to: '/Appointment',
    icon: <CIcon icon={ cilHospital} customClassName="nav-icon" />,
    items: [
      {
        component: CNavItem,
        name: 'Doctor schedule',
        to: '/Appointment/Doctor schedule',
      },
      {
        component: CNavItem,
        name: 'Book appointment',
        to: '/Appointment/Book doctor',
      },
    ],
  },
  {
    component: CNavGroup,
    name: 'Patient',
    to: '/Patient',
    icon: <CIcon icon={ cilHospital} customClassName="nav-icon" />,
    items: [
      {
        component: CNavItem,
        name: 'Add patient',
        to: '/Patient/Add patient',
      },
      {
        component: CNavItem,
        name: 'All patient',
        to: '/Patient/All patient',
      },
      {
        component: CNavItem,
        name: 'Patient profile',
        to: '/Patient/Book doctor',
      },
    ],
  },


  {
    component: CNavGroup,
    name: 'Pages',
    icon: <CIcon icon={cilStar} customClassName="nav-icon" />,
    items: [
      {
        component: CNavItem,
        name: 'Login',
        to: '/login',
      },
      {
        component: CNavItem,
        name: 'Register',
        to: '/register',
      },
      {
        component: CNavItem,
        name: 'Error 404',
        to: '/404',
      },
      {
        component: CNavItem,
        name: 'Error 500',
        to: '/500',
      },
    ],
  },
]


export default _nav
